import React from 'react';

const Skills = () => {
    const skillImages = [
        "/images/python_18894.webp",
        "/images/file_type_html_icon_130541.webp",
        "/images/github_original_wordmark_logo_icon_146506.webp",
        "/images/java_original_wordmark_logo_icon_146459.webp",
        "/images/c_icon_132529.webp",
        "/images/docker_original_wordmark_logo_icon_146557.webp"
    ];
  
    return (
        <section id="skills" className="skills-section">
            <h2>Skills</h2>
            <div className="cells">
                {skillImages.map((imagePath, index) => (
                    <div key={index} className="cell">
                        <img 
                            src={imagePath} 
                            alt={`Skill logo ${index + 1}`} 
                            style={{ 
                                width: '100px', 
                                height: '100px', 
                                border: '3px solid red',
                                objectFit: 'contain'
                            }} 
                            onError={(e) => {
                                console.error('Image failed to load:', e.target.src);
                                e.target.style.display = 'none';
                            }}
                        />
                        <p>{imagePath}</p>
                    </div>
                ))}
            </div>
        </section>
    );
};

export default Skills;
